import UnauthenticatedApp from './UnauthenticatedApp'
import Login from './Login'

import React, { useState, useEffect } from 'react'
import { Navigate, Routes, Route } from 'react-router-dom'

function App() {
  const [currentMember, setCurrentMember] = useState(null)
  const [authChecked, setAuthChecked] = useState(false)

  console.log(currentMember)
  useEffect(() => {
    fetch('/me', {
      credentials: 'include'
    })
      .then(res => {
        if (res.ok) {
          res.json().then(member => {
            setCurrentMember(member)
            setAuthChecked(true)
          })
        } else {
          setAuthChecked(true)
        }
        console.log(authChecked)
     })
  }, [])

  //{return <div></div>}

  if(!currentMember) <Login setCurrentMember={setCurrentMember} />
  return (
    <div>

           <Routes>
            <Route path="*" element={member == null ? <Navigate to="/login" replace/> : <Navigate to="/" replace/>} />
            <Route path="/" element={<Login currentMember={currentMember} setCurrentMember={setCurrentMember}/>} />
            <Route path="/home"/>
          </Routes>

